exports.encode=function(b){var c="";for(var a in b){if(b.hasOwnProperty(a)){if(c.length){c+="&"}c+=encodeURIComponent(a)+"="+encodeURIComponent(b[a])}}return c};exports.decode=function(a){var d={};var e=a.split("&");for(var c=0,b=e.length;c<b;c++){var f=e[c].split("=");d[decodeURIComponent(f[0])]=decodeURIComponent(f[1])}return d};